function Navbar(){
    return (
        <nav className="navbar navbar-expand navbar-dark bg-dark">
            <div className="container-fluid">
                <a className="navbar-brand" href="/home">Home</a>
                <div className="collapse navbar-collapse" id="navbarNav">
                </div>
            </div>
        </nav>
    )
}
export default Navbar;
